import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const Introduction = () => {
	return (
		<div>
			<Grid container direction='column' alignItems='cetner'>
				<Button variant='outlined' size='medium' color='primary' startIcon={<ExpandMoreIcon />}>
					بیشتر
				</Button>
			</Grid>
		</div>
	);
};

export default Introduction;
